import React,{Component} from 'react';
import { Button, Row, Col, Card, Form, Alert } from "react-bootstrap";

export default class Login extends Component{
    constructor()
    {
        super()
    }

    render()
    {
        return(
            <div className="formDiv">
              <center>
              <br/>
              <br/> <br/> <br/>
              <div className="myForm">              
                <form>
                  <table>
                  <tr> <td>Email Id</td>        <td>&nbsp;</td>            <td><input type="email" name="uname"/></td>         </tr>

                 <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>


                 <tr> <td>Password</td>           <td>&nbsp;</td>          <td><input type="password" name="uname"/></td>         </tr>

                 <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>

                 <tr> <td> <input type="reset"/> </td>           <td>&nbsp;</td>          <td><input type="submit" name="uname" /></td>         </tr>

                 <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>

                 <tr> <td>Register</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>


                 </table>
                 </form>
                </div>
              </center>

            </div>

        );
    }
}
